import React from "react";
import { View, ScrollView, Text } from "react-native";
import styled from "styled-components/native";
import {
  useSafeAreaInsets,
  SafeAreaView,
} from "react-native-safe-area-context";

const SafeCon = styled.SafeAreaView`
  width: 100%;
  background-color: white;
`;

const Con = styled.SafeAreaView`
  height: 100%;
  width: 100%;
`;

const ListCard = styled.ScrollView`
  height: 100%;
  width: 100%;
  padding: 15px;
`;

const Card = styled.ScrollView`
  width: 100%;
  height: 200px;
`;

const ShopDes = styled.Text`
  margin-top: 6px;
  font-size: 20px;
`;

const HeaderLogo = styled.Text`
  font-size: 16px;
  color: black;
  padding: 15px;
`;

export { Con, HeaderLogo, SafeCon, ListCard, Card, ShopDes };
